import React, { useState, useEffect } from 'react'
import Typography from '@mui/material/Typography'
import Grid from '@mui/material/Grid'
import Button from '@mui/material/Button'
import RenderTextField from './RenderTextField'
import DateSelection from './DateSelection'
import { buildElement } from './builders.js'

const StnHourlyInput = (props) => { 
  const [ datastate, setDatastate] = useState ({
    sid: '',
    sdate: '',
    edate: '',
    date: '',
    elems: '',
    vX: '',
    vN: '',
    prec: '',
    meta: '',
  })
  const [ hasInterval, setHasInterval ] = useState(false)
  const [ hasElemsError, setHasElemsError ] = useState(false)

  const datafields = ['sid','sdate','edate','date','elems','meta']
  const elementKeys = Object.keys(datastate).filter(
    item => (!datafields.includes(item)
  ))

  const updateParam = (update) => {
    setDatastate({...datastate, ...update})
    props.updateInputParams(update)
  }

  const updateElemBuild = (update) => {
    setDatastate({...datastate, ...update})
  }

  const addElement = (event) => {
    const action = event.currentTarget.id   //"add" or "replace"
    const newElems = JSON.stringify(buildElement(elementKeys, datastate, action))
    setDatastate({...datastate, ...{elems: newElems}})
    props.updateInputParams({elems: newElems})
    props.updateHelpFor("")
  }

  const clearElements = () => {
    setDatastate({...datastate, ...{elems: ''}})
    props.updateInputParams({elems: ""})
    props.updateHelpFor("")
    setHasInterval(false)
    setHasElemsError(false)
  }

  const updateHelpFor = (helpFor) => {
    if (helpFor === 'sid') {
      helpFor = 'hrly_sid'
    } else if (helpFor === 'elems') {
      helpFor = "hrly_elems"
    }
    props.updateHelpFor(helpFor)
  }

  const updateElems = (update) => {
    setDatastate({...datastate, ...update})
    try {
      JSON.parse(update.elems)
      setHasElemsError(false)
      props.updateInputParams(update)
    } catch {
      setHasElemsError(true)
    }
  }

  // Update local variable storage whenever input_params updates
  useEffect(() => {
    let newstate= {}
    datafields.forEach((key) => {
      if (props.input_params.hasOwnProperty(key)) {
        if (key === 'elems' && typeof props.input_params.elems === 'object') {
          newstate= ({...newstate, ...{[key]: JSON.stringify(props.input_params.elems)}})
          setHasInterval(checkHasInterval({[key]: JSON.stringify(props.input_params.elems)}))
        } else {
          newstate= ({...newstate, ...{[key]: props.input_params[key]}})
        }
      } else {
        newstate = ({...newstate, ...{[key]: ''}})
      }
    })
    setDatastate({...datastate, ...newstate})
    // eslint-disable-next-line
  }, [props.input_params])

  return (
    <div>
      <Grid container>
        <Grid item xs={4}>
          <Typography variant="h6">
            Required input
          </Typography>
          <RenderTextField
            id="sid"
            fieldlabel="Station ID"
            value={datastate.sid}
            updateHelpFor={updateHelpFor}
            updateParam={updateParam}
          />
          <DateSelection
            sdate={datastate.sdate}
            edate={datastate.edate}
            date={datastate.date}
            updateHelpFor={updateHelpFor}
            updateParam={updateParam}
          />
          <RenderTextField
            id="elems"
            fieldlabel="Elements"
            value={datastate.elems}
            options={{style: {width:"90%"}, multiline: true, placeholder: "Enter directly or build using Element setup"}}
            updateHelpFor={updateHelpFor}
            updateParam={updateElems}
          />
          {datastate.elems.includes("{") &&
            <Button 
              size="small"
              variant="outlined"
              style={{marginTop:"0.5em"}}
              onMouseDown={clearElements}
            >
              Clear elements
            </Button>
          }
        </Grid>

        <Grid item xs={4}>
          <Typography variant="h6">
            Optional element builder
          </Typography>
          <RenderTextField
            id="vX"
            fieldlabel="Var major"
            value={datastate.vX}
            updateHelpFor={updateHelpFor}
            updateParam={updateElemBuild}
          />
          <RenderTextField
            id="vN"
            fieldlabel="Var minor"
            value={datastate.vN}

            updateHelpFor={updateHelpFor}
            updateParam={updateElemBuild}
          />
          <RenderTextField
            id="prec"
            fieldlabel="Precision"
            value={datastate.prec}
            updateHelpFor={updateHelpFor}
            updateParam={updateElemBuild}
          />

          {datastate.vX.length > 0 &&
            <Button
              id="add"
              size="small"
              variant="outlined"
              style={{marginTop:"0.5em"}}
              onMouseDown={addElement}
            >
              Add element
            </Button>
          }
          {datastate.vX.length > 0 && datastate.elems.includes("{") &&
            <Button 
              id="replace"
              size="small"
              variant="outlined"
              style={{marginTop:"0.5em", marginLeft:"0.5em"}}
              onMouseDown={addElement}
            >
              Replace elements
            </Button>
          }
        </Grid>

        <Grid item xs={4}>
          <Typography variant="h6">
            Optional input
          </Typography>
          <RenderTextField
            id="meta"
            fieldlabel="Meta options"
            value={datastate.meta}
            options={{style: {width:"95%"}}}
            updateHelpFor={updateHelpFor}
            updateParam={updateParam}
          />
        </Grid>
      </Grid>
    </div>
  )
}

export default StnHourlyInput
